// SPDX-License-Identifier: MIT
pragma solidity 0.8.28;

import "@openzeppelin/contracts/access/Ownable.sol";

contract Moonbag is Ownable {
    struct LockedFund {
        uint256 amount;
        uint256 unlockTime;
    }

    mapping(address => LockedFund) public lockedFunds;
    uint256 public lockDuration = 30 days;

    event Locked(address indexed user, uint256 amount, uint256 unlockTime);
    event Withdrawn(address indexed user, uint256 amount);

    constructor() Ownable(msg.sender) {}

    function lock() external payable {
        require(msg.value > 0, "Must lock some ETH");
        require(lockedFunds[msg.sender].amount == 0, "Already locked");

        lockedFunds[msg.sender] = LockedFund(msg.value, block.timestamp + lockDuration);
        emit Locked(msg.sender, msg.value, block.timestamp + lockDuration);
    }

    function withdraw() external {
        LockedFund storage fund = lockedFunds[msg.sender];
        require(fund.amount > 0, "No locked funds");
        require(block.timestamp >= fund.unlockTime, "Funds are locked");

        uint256 amount = fund.amount;
        fund.amount = 0;

        payable(msg.sender).transfer(amount);
        emit Withdrawn(msg.sender, amount);
    }

    function setLockDuration(uint256 _duration) external onlyOwner {
        lockDuration = _duration;
    }
}

