// SPDX-License-Identifier: MIT
pragma solidity 0.8.28;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

interface IPencilsProtocol {
    function stake(uint256 amount) external;
    function unstake(uint256 amount) external;
    function claimRewards() external returns (uint256);
}

contract YieldOptimizedSavings is Ownable {
    IERC20 public immutable token;
    IPencilsProtocol public pencilsProtocol;

    mapping(address => uint256) public userShares;
    uint256 public totalShares;
    uint256 public investedBalance;

    event Deposited(address indexed user, uint256 amount, uint256 sharesMinted);
    event Withdrawn(address indexed user, uint256 amount, uint256 sharesBurned);
    event Invested(uint256 amount);
    event Harvested(uint256 rewards);

    constructor(address _token) Ownable(msg.sender) {
        token = IERC20(_token);
    }

    function totalAssets() public view returns (uint256) {
        return investedBalance + token.balanceOf(address(this));
    }

    function setPencilsProtocol(address _protocol) external onlyOwner {
        pencilsProtocol = IPencilsProtocol(_protocol);
    }

    function deposit(uint256 amount) external {
        require(amount > 0, "Cannot deposit zero tokens");
        require(token.transferFrom(msg.sender, address(this), amount), "Transfer failed");

        uint256 sharesToMint = totalShares == 0 ? amount : (amount * totalShares) / totalAssets();
        userShares[msg.sender] += sharesToMint;
        totalShares += sharesToMint;

        emit Deposited(msg.sender, amount, sharesToMint);
    }

    function withdraw(uint256 amount) external {
        uint256 sharesToBurn = (amount * totalShares) / totalAssets();
        require(userShares[msg.sender] >= sharesToBurn, "Insufficient balance");
        userShares[msg.sender] -= sharesToBurn;
        totalShares -= sharesToBurn;

        uint256 idleTokens = token.balanceOf(address(this));
        if (idleTokens < amount) {
            uint256 diff = amount - idleTokens;
            pencilsProtocol.unstake(diff);
            investedBalance -= diff;
        }
        require(token.transfer(msg.sender, amount), "Transfer failed");
        emit Withdrawn(msg.sender, amount, sharesToBurn);
    }

    function invest() external onlyOwner {
        uint256 balance = token.balanceOf(address(this));
        require(balance > 0, "No tokens available for investment");
        require(address(pencilsProtocol) != address(0), "Pencils Protocol not set");

        require(token.approve(address(pencilsProtocol), balance), "Approval failed");
        pencilsProtocol.stake(balance);
        investedBalance += balance;
        emit Invested(balance);
    }

    function harvestYield() external onlyOwner {
        require(address(pencilsProtocol) != address(0), "Pencils Protocol not set");
        uint256 rewards = pencilsProtocol.claimRewards();
        investedBalance += rewards;
        emit Harvested(rewards);
    }
}

